function initMap() {
  var center = new google.maps.LatLng(39.9087,116.3975);
  var mapOptions = {
      zoom: 10,
      center: center,
      mapTypeId: google.maps.MapTypeId.ROADMAP
  };
  var map = new google.maps.Map(document.getElementById("map"),
          mapOptions);

  for (var i = 0; i < data.length; i++) {  
      var teamLatLng = new google.maps.LatLng(data[i].Lat, data[i].Lng);
      marker = new google.maps.Marker({
          position: teamLatLng,
          map: map,
      });
      markers.push(marker);

      const infowindow = new google.maps.InfoWindow({
        content: 'House Name: ' + data[i].HouseName + '<br>' +
                 'Bedrooms: ' + data[i].Bedrooms + '<br>' +
                 'Living Rooms: ' + data[i].LivingRooms + '<br>' +
                 'Kitchens: ' + data[i].Kitchens + '<br>' + 
                 'Bathrooms: ' + data[i].Bathrooms + '<br>' +
                 'Square: ' + data[i].Square +  ' m²' + '<br>' +
                 'Price: ¥ ' + data[i].Price  + '<br>' +
                 'Total Price: ¥ ' + data[i].TotalPrice
      });
  
      google.maps.event.addListener(marker, 'click', (function(marker, i) {
          return function() {
              map.setZoom(14);
              map.setCenter(markers[i].getPosition()); 
              infowindow.open({
                anchor: marker,
                map,
                shouldFocus: false,
          });
          
      }})(marker, i));
  }
}
google.maps.event.addDomListener(window, "load", initMap);